import React from "react";


class TemperatureSlider extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            value: 0
        };
    }

    handleChange(event) {
        this.setState({value: event.target.value});
    }

    render() {
        return (
            <div>
                <input className="generalSlider" type="range" min="0" max="6000" value={this.state.value} onChange={this.handleChange} />
            </div>
        );
    }
}

class PressureSlider extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            value: 0
        };
    }

    handleChange(event) {
        this.setState({value: event.target.value});
    }

    render() {
        return (
            <div>
                <input className="generalSlider" type="range" min="0" max="6000" value={this.state.value} onChange={this.handleChange} />
            </div>
        );
    }
}

class SliderCollection extends React.Component {
    constructor(props) {
        super(props);
    } 

    render() {
        return (
            <div>
                <TemperatureSlider />
                <PressureSlider />
            </div>
        );
    }
}

export default SliderCollection
